import React from 'react';
import Spinner from '../components/Spinner';
import Topbar from '../components/Topbar';
import Navbar from '../components/Navbar';
import PageHeader from '../components/PageHeader';
import Footer from '../components/Footer';
import BackToTop from '../components/BackToTop';

const Projects = () => {
  return (
    <>
      <Spinner />
      <Topbar />
      <Navbar />
      <PageHeader title="Our Projects" />
      
      <div className="container-xxl project py-5">
        <div className="container">
          <div className="text-center mx-auto mb-5 wow fadeInUp" data-wow-delay="0.1s" style={{ maxWidth: '600px' }}>
            <h4 className="section-title">Our Projects</h4>
            <h1 className="display-5 mb-4">Visit Our Latest Projects And Our Innovative Works</h1>
          </div>
          <div className="row g-4">
            {['project-1.jpg', 'project-2.jpg', 'project-3.jpg', 'project-4.jpg'].map((img, idx) => (
              <div key={idx} className="col-lg-6 col-md-6 wow fadeInUp" data-wow-delay={`${idx * 0.2 + 0.1}s`}>
                <div className="position-relative" style={{ minHeight: '350px' }}>
                  <img className="img-fluid w-100 h-100" src={`/img/${img}`} style={{ objectFit: 'cover' }} alt="" />
                </div>
              </div>
            ))}
          </div>
        </div>
      </div>

      <Footer />
      <BackToTop />
    </>
  );
};

export default Projects;
